import { Marker, Popup } from 'react-leaflet';

function MarkerPoint(props) {

  const latlng = [props.lat, props.lng]

  return (
    <Marker position={latlng} id={props.id}>
        <Popup>
          <h1>{props.date}</h1>
          <p>{props.filename}</p>
          <img src={"../"+props.filename} alt="sick image"/>
          <p>{props.notes}</p>
        </Popup>
    </Marker>
  );
}

export default MarkerPoint;
